    {
      id: 1,
      name: "Chicken",
      Serving: 3,
      coockTime: "1:45",
      Instructions: "1.Put 1 2.Put 2 3.Put 3 4.Put 4 5.Put 5",
      ingredients: {
        id: 1,
        part1: "Chicekn",
        quantity1: "1kg",
        part2: "Salt",
        quantity2: "1 spoon",
      },
    },
    {
      id: 2,
      name: "Soup",
      Serving: 2,
      coockTime: "2:45",
      Instructions: "1.Put 1 2.Put 2 3.Put 3 4.Put 4 5.Put 5",
      ingredients: {
        id: 2,
        part1: "Chicekn",
        quantity1: "0.5kg",
        part2: "Vegetables",
        quantity2: 0,
      },
    },
  ];

  return (
    <RecepieList recepies={sampleRecepies} ingredients={ingredientsSample} />
  );
}
